import React from 'react'

const RightDiv = () => {
    return (
      <div
        className="RightDiv w-1/2 h-screen bg-cover bg-center"
      >
        {/* Content inside the RightDiv */}
      </div>
    );
  };
  
export default function App() {
    return (
        <div>
            <RightDiv/>
        </div>
    )
}
